CREATE TABLE pokemons (
  id INTEGER PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  encoded_img TEXT
);

CREATE TABLE types (
  id INTEGER PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  pokemon_id INTEGER,

  FOREIGN KEY(pokemon_id) REFERENCES pokemon(id)
);

